import React, { useEffect, useState } from "react";
import Styles from "./Selector.module.scss";

const Selector = ({
  fields,
  onClickFunction,
  heading,
  setOpenedSelector,
  name,
  openedSelector,
}) => {
  return (
    <select className={Styles.select}>
      <optgroup>
        <option value="1">акции</option>
        <option value="2">акции2</option>
        <option value="3">акции3</option>
        <option value="4">акции4</option>
      </optgroup>
    </select>
  );
};
export default Selector;
